(1, 'رحلة شهر العسل فى بالى - أندونيسيا 1', 'بالى هى واحدة من أجمل جزر العالم.\nيزورها كم هائل من السيَاح بهدف الاستجمام والاستمتاع بطبيعتها الخلَابة وغاباتها الاستوائية وسحر شواطئها.\nوتحتوى الجزيرة على مدرجات الأرز الخلابة وشواطئ بيضاء أخرى مغطاة برمال بركانية رمادية وسوداء.', 'images/blogs/blog-5db2031b504ab/blog-default-image-5db2031b50679.jpg', 'images/blogs/blog-5db2031b504ab/blog-image-5db2031b6bea3.jpg,images/blogs/blog-5db2031b504ab/blog-image-5db2031b82254.jpg,images/blogs/blog-5db2031b504ab/blog-image-5db2031b9cdee.jpg,images/blogs/blog-5db2031b504ab/blog-image-5db2031bacc1f.jpg,images/blogs/blog-5db2031b504ab/blog-image-5db2031bb6b14.jpg', 1, 1, NULL, '2019-10-24 20:01:31', '2019-10-24 20:01:31'),
(2, 'رحلة شهر العسل فى بالى - أندونيسيا 2', 'بالى هى واحدة من أجمل جزر العالم.\nيزورها كم هائل من السيَاح بهدف الاستجمام والاستمتاع بطبيعتها الخلَابة وغاباتها الاستوائية وسحر شواطئها.\nوتحتوى الجزيرة على مدرجات الأرز الخلابة وشواطئ بيضاء أخرى مغطاة برمال بركانية رمادية وسوداء.\n\nبالى هى واحدة من أجمل جزر العالم.\nيزورها كم هائل من السيَاح بهدف الاستجمام والاستمتاع بطبيعتها الخلَابة وغاباتها الاستوائية وسحر شواطئها.\nوتحتوى الجزيرة على مدرجات الأرز الخلابة وشواطئ بيضاء أخرى مغطاة برمال بركانية رمادية وسوداء.\n\nبالى هى واحدة من أجمل جزر العالم.\nيزورها كم هائل من السيَاح بهدف الاستجمام والاستمتاع بطبيعتها الخلَابة وغاباتها الاستوائية وسحر شواطئها.\nوتحتوى الجزيرة على مدرجات الأرز الخلابة وشواطئ بيضاء أخرى مغطاة برمال بركانية رمادية وسوداء.\n\nبالى هى واحدة من أجمل جزر العالم.\nيزورها كم هائل من السيَاح بهدف الاستجمام والاستمتاع بطبيعتها الخلَابة وغاباتها الاستوائية وسحر شواطئها.\nوتحتوى الجزيرة على مدرجات الأرز الخلابة وشواطئ بيضاء أخرى مغطاة برمال بركانية رمادية وسوداء.', 'images/blogs/blog-5db2038954595/blog-default-image-5db2038954d3a.jpg', 'images/blogs/blog-5db2038954595/blog-image-5db203897ca3e.jpg,images/blogs/blog-5db2038954595/blog-image-5db203899aaec.jpg,images/blogs/blog-5db2038954595/blog-image-5db20389ac414.png,images/blogs/blog-5db2038954595/blog-image-5db2038bc517d.jpg,images/blogs/blog-5db2038954595/blog-image-5db2038bd80e5.jpg,images/blogs/blog-5db2038954595/blog-image-5db2038dbb1fd.jpg', 1, 1, NULL, '2019-10-24 20:03:26', '2019-10-24 20:26:26'),
